import React,{useState} from 'react';
import {link} from 'react-dom-router'; 
function Navbar() {
    return (
        <>
        <nav className="navbar">
            <div className="navbar-container">
            <link to="/" className="navbar-logo">  
            mehdi <i className="fab fa-typo3"></i>
            </link>
            </div>
        </nav>
        </>
    )
}

export default Navbar
